import styled from "styled-components";

const Button = styled.button`
  background: red;
  width: 50%;
  height: 100px;
  color: white;
  font-weight: 500;
  border: 0;
  border-radius: 0;
  font-size: 200%;
  padding: 5px;
  margin-top: 10px;
  margin-bottom: 10px;
  background: linear-gradient(
    to right,
    #38ef7d,
    #11998e
  ); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */
`;

export default Button;
